The first step in integrating rustBoot is flash-memory partitioning i.e. we divide the nrf52840's flash-memory into 4 partitions, taking into account the geometry of the flash memory. You can read more about mcu partitioning here In this example, we'll be using the following partitioning scheme. You can locate these constants in the constants module #[cfg(feature = "nrf52840")]
pub const SECTOR_SIZE: usize = 0x1000;
#[cfg(feature = "nrf52840")]
pub const PARTITION_SIZE: usize = 0x28000;
#[cfg(feature = "nrf52840")]
pub const BOOT_PARTITION_ADDRESS: usize = 0x2f000;
#[cfg(feature = "nrf52840")]
pub const SWAP_PARTITION_ADDRESS: usize = 0x57000;
#[cfg(feature = "nrf52840")]
pub const UPDATE_PARTITION_ADDRESS: usize = 0x58000; RUSTBOOT partition: contains the bootloader (its code and data) and a (test) public-key embedded as part of the bootloader image, starts at address 0x0. BOOT partition: contains boot firmware, starts at address PARTITION_BOOT_ADDRESS. UPDATE partition: contains update firmware, starts at address UPDATE_PARTITION_ADDRESS. The boot firmware is responsible for downloading and installing the update firmware into this partition via a secure channel. SWAP partition: is the temporary swap space, starts at address SWAP_PARTITION_ADDRESS.

